import React from "react";
import Slider from "react-slick"; // carousel component
import {
  Card,
  CardContent,
  Typography,
  CardActions,
  Button,
} from "@mui/material";
import "./Programs.css"; // your custom styles

const Programs = () => {
  // Sample card data
  const cardData = [
    { title: "Card 1", description: "Description for card 1." },
    { title: "Card 2", description: "Description for card 2." },
    { title: "Card 3", description: "Description for card 3." },
    { title: "Card 4", description: "Description for card 4." },
    { title: "Card 5", description: "Description for card 5." },
    { title: "Card 6", description: "Description for card 6." },
  ];

  // Slick carousel settings
  const settings = {
    dots: false,
    infinite: true,        // loop continuously
    speed: 3000,           // scroll speed
    autoplay: true,        // enable auto scroll
    autoplaySpeed: 0,      // continuous without delay
    cssEase: "linear",     // smooth continuous effect
    slidesToShow: 4,       // default: 4 cards on desktop
    slidesToScroll: 1,
    responsive: [
      {
        breakpoint: 1200, // Tablet
        settings: {
          slidesToShow: 3,
        },
      },
      {
        breakpoint: 768, // Mobile
        settings: {
          slidesToShow: 1,
        },
      },
    ],
  };

  return (
    <div className="cards-container">
      <Slider {...settings}>
        {cardData.map((card, index) => (
          <div key={index}>
            <Card
              className={`card ${
                // Apply "large" style to center cards
                (index % 4 === 1 || index % 4 === 2) ? "large" : ""
              }`}
            >
              <CardContent>
                <Typography variant="h6" gutterBottom>
                  {card.title}
                </Typography>
                <Typography variant="body2" color="text.secondary">
                  {card.description}
                </Typography>
              </CardContent>
              <CardActions>
                <Button size="small" sx={{ color: "#d36408" }}>
                  Learn More
                </Button>
              </CardActions>
            </Card>
          </div>
        ))}
      </Slider>
    </div>
  );
};

export default Programs;
